public class LinkedInSlots_ComputeCellMetricsBatch extends LinkedInSlots_BatchCoordinator {
 List<SourcingPlatformDetails> sourcingPlatforms;
 Date minLastModifiedDate;
 Date maxLastModifiedDate;

 public LinkedInSlots_ComputeCellMetricsBatch(LinkedInSlots_BatchCoordinator coordinator, Date minLastModifiedDate, Date maxLastModifiedDate) {
 this.coordinator = coordinator;
 this.sourcingPlatforms = sourcingPlatforms;
 this.minLastModifiedDate = minLastModifiedDate;
 this.maxLastModifiedDate = maxLastModifiedDate;

 if (sourcingPlatforms == null || sourcingPlatforms.size() == 0) {
 throw new InvalidParameterException('sourcingPlatforms', 'Should have at least one element');
 }

 processedCells = new Map<String, Set<Id>>();
 this.sourcingPlatforms = sourcingPlatforms;
 this.coordinator = coordinator;
 this.minLastModifiedDate = minLastModifiedDate;
 this.maxLastModifiedDate = maxLastModifiedDate;
 this.minCreationDate = minLastModifiedDate.addDays(-1);
 this.maxCreationDate = maxLastModifiedDate.addDays(-2);

 for (SourcingPlatformDetails platform : sourcingPlatforms) {
 processedCells.put(platform.recordTypeName, new Set<Id>());
 }

